import { Component, ElementRef, VERSION, ViewChild } from '@angular/core';
import * as pdfjsLib from 'pdfjs-dist';

@Component({
  selector: 'my-app',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent {
  name = 'Angular ' + VERSION.major;

  @ViewChild('myCanvas', { static: false }) canvas: ElementRef;

  constructor() {
    var url =
      'https://raw.githubusercontent.com/mozilla/pdf.js/ba2edeae/examples/learning/helloworld.pdf';
    let pdfData = atob(
      ''
    );

    //
    // The workerSrc property shall be specified.
    //
    pdfjsLib.GlobalWorkerOptions.workerSrc =
      'https://cdnjs.cloudflare.com/ajax/libs/pdf.js/2.5.207/pdf.worker.min.js';

    //
    // Asynchronous download PDF
    //
    var loadingTask = pdfjsLib.getDocument({ data: pdfData });
    loadingTask.promise.then((pdf) => {
      //
      // Fetch the first page
      //
      pdf.getPage(1).then((page) => {
        var scale = 1.5;
        var viewport = page.getViewport({ scale: scale });

        //
        // Prepare canvas using PDF page dimensions
        //
        var context = this.canvas.nativeElement.getContext('2d');
        this.canvas.nativeElement.height = viewport.height;
        this.canvas.nativeElement.width = viewport.width;

        //
        // Render PDF page into canvas context
        //
        var renderContext = {
          canvasContext: context,
          viewport: viewport,
        };

        const renderTask = page.render(renderContext);

        console.log('coneole created');
        
        renderTask.promise.then(() => {
          console.log('drawing');
          this.drawRectangle(context, 0, 0, 100, 100);
        });
      });
    });
  }

  drawRectangle(ctx, x, y, w, h) {
    //ctx.strokeStyle = 0;
    ctx.strokeRect(x, y, w, h);
  }
}
